package main

import (
	"fmt"
)

/*
 * Complete the 'gameOfThrones' function below.
 *
 * The function is expected to return a STRING.
 * The function accepts STRING s as parameter.
 * https://www.hackerrank.com/challenges/game-of-thrones/problem?isFullScreen=false
 */

func gameOfThrones(s string) string {

	var line string
	fmt.Scanf("%s", line)

	histogram := make([]int, 26)
	for _, c := range line {
		idx := c - 'a'
		histogram[idx]++
	}

	var oddAcceptance int
	if len(line)&0x1 == 1 {
		oddAcceptance = 1
	}
	for _, cnt := range histogram {
		isOdd := cnt&0x1 == 1
		if isOdd {
			if oddAcceptance > 0 {
				oddAcceptance--
			} else {
				return "NO"
			}
		}
	}

	return "YES"

}

func main() {

	s := ""
	result := gameOfThrones(s)

	fmt.Println(result)

}
